    <Card className={classes.container}>
      <div className={classes.panelcontainer}>
        <Card className={classes.panelBorrow}>
          <Borrow
            start={classes.header}
            container={classes.inputscontainer}
            setData={setData}
          />
        </Card>
        <Card className={classes.panelLend}>
          <Lend header={classes.header} container={classes.inputscontainer} />
        </Card>
      </div>
      <div className={classes.panelcontainer}>
        <Card className={classes.panelCNFT}>
          <CNFT
            header={classes.header}
            headline={setChecked}
            container={classes.inputscontainer}
            data={data}
          />
        </Card>
        <Card className={classes.panelCrypto}>
          <Crypto headline={setChecked} data={data} header={classes.header} container={classes.inputscontainer} />
        </Card>
      </div>
    </Card>
  );
}

export default CNiphtyProphet;
